import React from 'react'

function LoginPage() {
  return (
   <form className='login' >
    <h1>Login</h1>
    <input type='text' placeholder='usename'></input>
    <input type='password' placeholder='password'></input> 
    <button type='submit'>Login</button>
   </form>
  )
}

export default LoginPage
